import { NavLink } from "react-router-dom";
import { FaShoppingCart } from "react-icons/fa";

const Navbar = () => {
  return (
    <div className="bg-slate-900 py-[0.5rem]">
      <div className="flex justify-between items-center max-w-[1080px] mx-auto w-screen">
        <NavLink to={"/"}>
          <img src="../logo.png" alt="Logo" className="w-[140px]" />
        </NavLink>

        <div className="flex items-center space-x-2">
          <NavLink to={"/"} className="text-white text-sm">
            Home
          </NavLink>
          <NavLink to={"/cart"}>
            <FaShoppingCart className="text-slate-200 text-lg"/>
          </NavLink>
        </div>
      </div>
    </div>
  );
};

export default Navbar;
